	@CompanyId    VARCHAR(20),
	@Name         VARCHAR(40),
	@Months       SMALLINT,
	@IsActive     BIT
AS
BEGIN
	SET NOCOUNT ON;
	
	IF EXISTS(SELECT * FROM RecallType WHERE ID = @RecallTypeId)
		BEGIN
			UPDATE	RecallType
			SET		CompanyID = @CompanyId,
					Name      = @Name,
					Months    = @Months
			WHERE	ID        = @RecallTypeId;
		END
	ELSE
	BEGIN
		INSERT INTO RecallType
				( CompanyID,  Name,  Months)

